"use strict";(self.webpackChunkf_arm=self.webpackChunkf_arm||[]).push([[996],{6792:i=>{i.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"F-ARM","href":"/2025-1A-T03-G27-PUBLICO/intro","docId":"intro","unlisted":false},{"type":"category","label":"Sprint 2","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Initial Research","href":"/2025-1A-T03-G27-PUBLICO/Sprint-2/Pesquisa","docId":"Sprint-2/Pesquisa","unlisted":false}],"href":"/2025-1A-T03-G27-PUBLICO/category/sprint-2"},{"type":"category","label":"Sprint 3","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Architecture","href":"/2025-1A-T03-G27-PUBLICO/Sprint-3/Arquitetura","docId":"Sprint-3/Arquitetura","unlisted":false},{"type":"link","label":"Financial Analysis","href":"/2025-1A-T03-G27-PUBLICO/Sprint-3/Analise-Financeira","docId":"Sprint-3/Analise-Financeira","unlisted":false},{"type":"link","label":"Risk Matrix","href":"/2025-1A-T03-G27-PUBLICO/Sprint-3/MatrizRisco","docId":"Sprint-3/MatrizRisco","unlisted":false},{"type":"link","label":"Value Proposition Canvas","href":"/2025-1A-T03-G27-PUBLICO/Sprint-3/ValueCanvas","docId":"Sprint-3/ValueCanvas","unlisted":false}],"href":"/2025-1A-T03-G27-PUBLICO/category/sprint-3"},{"type":"category","label":"Sprint 4","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Sprint 4","href":"/2025-1A-T03-G27-PUBLICO/Sprint-4/Pesquisa","docId":"Sprint-4/Pesquisa","unlisted":false},{"type":"link","label":"Solution Architecture","href":"/2025-1A-T03-G27-PUBLICO/Sprint-4/Arquitetura","docId":"Sprint-4/Arquitetura","unlisted":false},{"type":"link","label":"Financial Analysis","href":"/2025-1A-T03-G27-PUBLICO/Sprint-4/Analise-Financeira","docId":"Sprint-4/Analise-Financeira","unlisted":false},{"type":"link","label":"Risk Matrix","href":"/2025-1A-T03-G27-PUBLICO/Sprint-4/MatrizRisco","docId":"Sprint-4/MatrizRisco","unlisted":false},{"type":"link","label":"Value Proposition Canvas","href":"/2025-1A-T03-G27-PUBLICO/Sprint-4/ValueCanvas","docId":"Sprint-4/ValueCanvas","unlisted":false}],"href":"/2025-1A-T03-G27-PUBLICO/category/sprint-4"},{"type":"category","label":"Sprint 5","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Sprint 5","href":"/2025-1A-T03-G27-PUBLICO/Sprint-5/Pesquisa","docId":"Sprint-5/Pesquisa","unlisted":false}],"href":"/2025-1A-T03-G27-PUBLICO/category/sprint-5"}]},"docs":{"intro":{"id":"intro","title":"F-ARM","description":"Agricultural Remote Monitoring","sidebar":"tutorialSidebar"},"Sprint-2/Pesquisa":{"id":"Sprint-2/Pesquisa","title":"Initial Research","description":"\ud83d\ude80 MVP and Industrial Version","sidebar":"tutorialSidebar"},"Sprint-3/Analise-Financeira":{"id":"Sprint-3/Analise-Financeira","title":"Financial Analysis","description":"\ud83d\udccc MVP Costs","sidebar":"tutorialSidebar"},"Sprint-3/Arquitetura":{"id":"Sprint-3/Arquitetura","title":"Architecture","description":"The solution architecture was designed considering the MVP without 5G or LoRaWAN coverage. In this scenario, a LoRaWAN gateway would be configured to receive data from the ESP32 collector.","sidebar":"tutorialSidebar"},"Sprint-3/MatrizRisco":{"id":"Sprint-3/MatrizRisco","title":"Risk Matrix","description":"| Risk | Impact | Probability | Mitigation Plan |","sidebar":"tutorialSidebar"},"Sprint-3/ValueCanvas":{"id":"Sprint-3/ValueCanvas","title":"Value Proposition Canvas","description":"\ud83d\udd35 Customer Profile","sidebar":"tutorialSidebar"},"Sprint-4/Analise-Financeira":{"id":"Sprint-4/Analise-Financeira","title":"Financial Analysis","description":"The financial analysis of the proposed solution is structured in two main stages: the MVP (Minimum Viable Product) phase and the cost projection for an industrial, more robust, and scalable version. In the MVP phase, the main goal is to validate the system\'s functionality with reduced investments, while the industrial version focuses on reliability, certifications, and large-scale operation.","sidebar":"tutorialSidebar"},"Sprint-4/Arquitetura":{"id":"Sprint-4/Arquitetura","title":"Solution Architecture","description":"The architecture developed for the agricultural monitoring system was initially planned for a Minimum Viable Product (MVP) scenario, where no public 5G or LoRaWAN network coverage is assumed. Given this, the adopted model considers the installation of a dedicated gateway with LoRaWAN technology to act as an intermediary between the field collection devices and the cloud infrastructure, ensuring data transmission even in remote rural areas.","sidebar":"tutorialSidebar"},"Sprint-4/MatrizRisco":{"id":"Sprint-4/MatrizRisco","title":"Risk Matrix","description":"To ensure the feasibility and resilience of the agricultural environmental monitoring system, a risk matrix was developed that considers the main technical, operational, and strategic factors that could compromise the performance of the MVP and the industrial version of the solution. Identifying these risks allows for early planning of mitigation actions, preventing critical failures from becoming barriers to operation or scalability.","sidebar":"tutorialSidebar"},"Sprint-4/Pesquisa":{"id":"Sprint-4/Pesquisa","title":"Sprint 4","description":"Sensor Acquisition and Communication Interface","sidebar":"tutorialSidebar"},"Sprint-4/ValueCanvas":{"id":"Sprint-4/ValueCanvas","title":"Value Proposition Canvas","description":"The construction of the value proposition for the agricultural environmental monitoring solution stems from a deep understanding of the customer profile and operational needs in the field. Farmers, rural managers, cooperatives, and agribusiness companies constantly face challenges related to natural resource management, production predictability, and waste reduction. These users need to monitor environmental conditions such as soil humidity and temperature, nutrients, gases, and sun exposure to make more informed decisions regarding irrigation, fertilization, and crop management. The absence of real-time data and the high cost of traditional remote sensing solutions make this decision-making process difficult, compromising productivity and the efficient use of inputs.","sidebar":"tutorialSidebar"},"Sprint-5/Pesquisa":{"id":"Sprint-5/Pesquisa","title":"Sprint 5","description":"This sprint focused on the preparation of the development environment with PlatformIO and the development of a first functional code for sensors, with tests carried out via simulation on Wokwi. This stage serves as a basis for later evolving into a more robust IoT architecture using object-oriented programming (OOP).","sidebar":"tutorialSidebar"}}}}')}}]);